import React from 'react'

export default function Register() {
  return (
    <form>
        <label>Email</label>
        <input type='email' name='email'/>

        <label>Password</label>
        <input type='password' name='password'/>

        <label>Confirm password</label>
        <input type='password' name='password2'/>

    </form>
  );
}
